import {GET_ITEMS} from '../actions/types';

const initialState = 
    fetch('http://localhost:5000/cities/all')
    .then(results => {
      return results.json();
    }).then(data => {
        let cities = data.map((city) => {
          return(
            <div key={city}>
            <ul>
              <li>{city.name}</li>
            </ul>
            </div>
          )
        })
        this.setState({cities: cities});
    });

export default function (state = initialState, action) {
    switch(action.type) {
        case GET_ITEMS:
            return {
                ...state
            }
        default: 
            return state;
    }
};
